        img: faviconImage,
    },
    {
        id: 4,
        name: "Book",
        img: faviconImage,
    },
    {
        id: 5,
        name: "Book",
        img: faviconImage,
    },
    {
        id: 6,
        name: "Book",
        img: faviconImage,
    },
];

export default function Books() {
    const navigation = useNavigation();
        

    return(
        <View>
            <TouchableOpacity>
                <Text style={styles.searchbar}>Search</Text>
            </TouchableOpacity>
        </View>
    );
}

const styles = StyleSheet.create({
    searchbar: {
        fontSize: 30,
        marginTop: 20,
        textAlign: "center",
    }
})
